import React from 'react'
import Container from 'react-bootstrap/Container';
import styled from 'styled-components'
import FormControl from '@mui/material/FormControl';
import InputLabel from '@mui/material/InputLabel';
import Input from '@mui/material/Input';
import InputAdornment from '@mui/material/InputAdornment';
import IconButton from '@mui/material/IconButton';
import SearchIcon from '@mui/icons-material/Search';




const Home = () => {

  const Homewrapper=styled.section`
    position:relative;
    display:flex;
    background-color:white;
    .search_section{
      margin-top:20px;
      margin-bottom:100px;
      text-align:center;
      .search_area{
        input{
          height:2rem;
          color:${({theme})=>theme.colors.text7}
        }
        .Mui-focused{
          color:${({theme})=>theme.colors.header}
        }
        .css-1ptx2yq-MuiInputBase-root-MuiInput-root::after{
          border-bottom:4px solid ${({theme})=>theme.colors.headeractive}
        }
      }
    }

  `;

  return (
    <Homewrapper>
      <Container className='search_section'>
      /*search text field start*/
        <div className='search_area'>
        <FormControl sx={{ m: 1, width: '50ch' }} variant="standard">
          <InputLabel htmlFor="standard-adornment-password">Search student By Name...</InputLabel>
          <Input
            id="standard-adornment-password"
            type= 'search'
            onChange=""
            endAdornment={
              <InputAdornment position="end">
                <IconButton 
                  aria-label="toggle password visibility"
                >
                  <SearchIcon />
                </IconButton>
              </InputAdornment>
            }
          />
        </FormControl>
        </div>
        //search text field end
      </Container>
    </Homewrapper>
  )
}

export default Home
